// Unpacks composite packed outputs recursively and writes each task's plain output to the output
// builtin.
//
// Arguments:
// n_subtasks - Number of direct subtasks to unfold.
// bootloader_config.
//
// Hint arguments:
// packed_outputs - PackedOutput object that stores the task tree structure.
//
// Implicit arguments:
// n_total_tasks - Number of PlainPackedOutput that were unpacked. This function increments this
// value for each unpacked output.
// subtasks_output - Contains direct subtasks outputs which is used for unpacking. This is an input
// to this function and is returned for validation purposes.
func parse_tasks{
    output_ptr: felt*,
    pedersen_ptr: HashBuiltin*,
    range_check_ptr,
    n_total_tasks: felt,
    subtasks_output: felt*,
}(bootloader_config: BootloaderConfig*, n_subtasks: felt) {
    if (n_subtasks == 0) {
        return ();
    }

    ap += SIZEOF_LOCALS;

    %{
        from starkware.cairo.bootloaders.bootloader.objects import PackedOutput

        task_id = len(packed_outputs) - ids.n_subtasks
        packed_output: PackedOutput = packed_outputs[task_id]

        vm_enter_scope(new_scope_locals=dict(packed_output=packed_output))
    %}

    %{
        from starkware.cairo.bootloaders.bootloader.objects import (
            CompositePackedOutput,
            PlainPackedOutput,
        )
    %}

    if (nondet %{ isinstance(packed_output, PlainPackedOutput) %} != 0) {
        // Handle plain packed task.
        unpack_plain_packed_task{task_output=subtasks_output}(bootloader_config=bootloader_config);
    } else {
        // Handle composite packed task.
        %{ assert isinstance(packed_output, CompositePackedOutput) %}
        unpack_composite_packed_task{task_output=subtasks_output}(
            bootloader_config=bootloader_config
        );
    }

    %{ vm_exit_scope() %}

    // Call recursively for handling the other tasks.
    return parse_tasks(bootloader_config=bootloader_config, n_subtasks=n_subtasks - 1);
}

// Serializes the bootloader config.
//
// Arguments:
// bootloader_config - A pointer to the bootloader config.
func serialize_bootloader_config{output_ptr: felt*, pedersen_ptr: HashBuiltin*}(
    bootloader_config: BootloaderConfig*
) {
    assert [output_ptr] = bootloader_config.simple_bootloader_program_hash;

    // Compute the hash of the supported Cairo verifiers.
    let (supported_cairo_verifiers_hash) = hash_felts{hash_ptr=pedersen_ptr}(
        data=bootloader_config.supported_cairo_verifier_program_hashes,
        length=bootloader_config.supported_cairo_verifier_program_hashes_len,
    );

    assert [output_ptr + 1] = supported_cairo_verifiers_hash;
    let output_ptr = output_ptr + 2;
    return ();
}

// Parses the task header.
//
// Implicit arguments:
// task_output - A pointer to the output of the plain packed task. Assumes that task_output is of
// the following format: (task_header, output).
func parse_task_header{task_output: felt*}() -> (task_header: TaskOutputHeader*) {
    let task_header = cast(task_output, TaskOutputHeader*);
    let task_output = task_output + TaskOutputHeader.SIZE;
    return (task_header=task_header);
}

// Unpacks a composite packed task output.
//
// Arguments:
// bootloader_config.
//
// Implicit arguments:
// task_output - A pointer to the output of the composite packed task. task_output should be of the
// following format:
// (output_len, cairo_verifier_program_hash, simple_bootloader_program_hash, output_hash).
// n_total_tasks - Number of PlainPackedOutput that were unpacked.
//
// Hint arguments:
// packed_output - CompositePackedOutput object which uses for unpacking the task.
func unpack_composite_packed_task{
    output_ptr: felt*,
    pedersen_ptr: HashBuiltin*,
    range_check_ptr,
    n_total_tasks: felt,
    task_output: felt*,
}(bootloader_config: BootloaderConfig*) {
    ap += SIZEOF_LOCALS;

    // Guess the pre-image of subtasks_output_hash (subtasks_output_hash appears in task_output).
    local nested_subtasks_output: felt*;
    local nested_subtasks_output_len;
    %{
        data = packed_output.elements_for_hash()
        ids.nested_subtasks_output_len = len(data)
        ids.nested_subtasks_output = segments.gen_arg(data)
    %}

    // Compute the hash of nested_subtasks_output.
    let (subtasks_output_hash) = hash_felts{hash_ptr=pedersen_ptr}(
        data=nested_subtasks_output, length=nested_subtasks_output_len
    );

    // Verify task output header.
    let (task_header: TaskOutputHeader*) = parse_task_header();
    assert task_header.size = TaskOutputHeader.SIZE + CairoVerifierOutput.SIZE;

    // Make sure the program hash is one of the supported verifier program hashes.
    find_element(
        array_ptr=bootloader_config.supported_cairo_verifier_program_hashes,
        elm_size=1,
        n_elms=bootloader_config.supported_cairo_verifier_program_hashes_len,
        key=task_header.program_hash,
    );

    // Verify task output.
    assert [cast(task_output, CairoVerifierOutput*)] = CairoVerifierOutput(
        program_hash=bootloader_config.simple_bootloader_program_hash,
        output_hash=subtasks_output_hash,
    );
    local task_output: felt* = task_output + CairoVerifierOutput.SIZE;

    // Call recursively to parse the composite task's subtasks.
    local nested_subtasks_output_start: felt* = nested_subtasks_output;
    let n_subtasks = [nested_subtasks_output];
    let nested_subtasks_output = nested_subtasks_output + 1;
    %{ packed_outputs = packed_output.subtasks %}
    with nested_subtasks_output {
        parse_tasks{subtasks_output=nested_subtasks_output}(
            bootloader_config=bootloader_config, n_subtasks=n_subtasks
        );
    }

    // Assert that the entire subtask output was used.
    assert nested_subtasks_output = nested_subtasks_output_start + nested_subtasks_output_len;
    return ();
}

// Unpacks a plain packed task output to the output builtin.
//
// Arguments:
// bootloader_config.
//
// Implicit arguments:
// task_output - A pointer to the output of the plain packed task. Assumes that task_output is of
// the following format: (output_len, cairo_verifier_program_hash, *output).
// n_total_tasks - Number of PlainPackedOutput that were unpacked. This function increments this
// value by 1.
func unpack_plain_packed_task{
    output_ptr: felt*,
    pedersen_ptr: HashBuiltin*,
    range_check_ptr,
    n_total_tasks: felt,
    task_output: felt*,
}(bootloader_config: BootloaderConfig*) {
    ap += SIZEOF_LOCALS;

    // Parse task output header.
    let (task_header: TaskOutputHeader*) = parse_task_header();
    local task_output: felt* = task_output;

    // Copy the simple bootloader output header to the bootloader output.
    assert [cast(output_ptr, TaskOutputHeader*)] = [task_header];

    // Increment output pointer.
    let output_ptr = output_ptr + TaskOutputHeader.SIZE;

    // Copy the program output to the bootloader output.
    local output_size = task_header.size - TaskOutputHeader.SIZE;
    memcpy(dst=output_ptr, src=task_output, len=output_size);

    // Increment pointers.
    let output_ptr = output_ptr + output_size;
    let task_output = task_output + output_size;
    let n_total_tasks = n_total_tasks + 1;
    return ();
}

from starkware.cairo.builtin_selection.inner_select_builtins import inner_select_builtins
from starkware.cairo.builtin_selection.select_input_builtins import select_input_builtins
from starkware.cairo.builtin_selection.validate_builtins import validate_builtins
from starkware.cairo.common.cairo_builtins import HashBuiltin
from starkware.cairo.common.hash_chain import hash_chain
from starkware.cairo.common.registers import get_ap, get_fp_and_pc

const BOOTLOADER_VERSION = 0;

// Use an empty struct to encode an arbitrary-length array.
struct BuiltinList {
}

struct ProgramHeader {
    // The data length field specifies the length of the data (i.e., program header + program)
    // and guarantees unique decoding of the program hash.
    data_length: felt,
    bootloader_version: felt,
    program_main: felt,
    n_builtins: felt,
    // 'builtin_list' is a continuous memory segment containing the ASCII encoding of the (ordered)
    // builtins used by the program.
    builtin_list: BuiltinList,
}

struct BuiltinData {
    output: felt,
    pedersen: felt,
    range_check: felt,
    ecdsa: felt,
    bitwise: felt,
    ec_op: felt,
    keccak: felt,
    poseidon: felt,
}

// Executes a single task.
// The task is passed in the 'task' hint variable.
// Outputs of the task are prefixed by:
//   a. Output size (including this prefix)
//   b. hash_chain(ProgramHeader || task.program.data) where ProgramHeader is defined below.
// The function returns a pointer to the updated builtin pointers after executing the task.
func execute_task{builtin_ptrs: BuiltinData*, self_range_check_ptr}(
    builtin_encodings: BuiltinData*, builtin_instance_sizes: BuiltinData*
) {
    // Allocate memory for local variables.
    alloc_locals;

    // Get the value of fp.
    let (local __fp__, _) = get_fp_and_pc();

    // Pointer to the program data (which starts with ProgramHeader).
    local program_data_ptr: felt*;
    %{ ids.program_data_ptr = program_data_base = segments.add() %}

    // The struct of input builtin pointers pointed by the given builtin_ptrs.
    let input_builtin_ptrs: BuiltinData* = builtin_ptrs;
    local output_ptr = input_builtin_ptrs.output;

    let program_header = cast(program_data_ptr, ProgramHeader*);
    %{
        from starkware.cairo.bootloaders.simple_bootloader.utils import load_program

        # Call load_program to load the program header and code to memory.
        program_address, program_data_size = load_program(
            task=task, memory=memory, program_header=ids.program_header,
            builtins_offset=ids.ProgramHeader.builtin_list)
        segments.finalize(program_data_base.segment_index, program_data_size)
    %}

    // Verify that the bootloader version is compatible with the bootloader.
    assert program_header.bootloader_version = BOOTLOADER_VERSION;

    // Call hash_chain, to verify the program hash.
    let pedersen_ptr = cast(input_builtin_ptrs.pedersen, HashBuiltin*);
    let (hash) = hash_chain{hash_ptr=pedersen_ptr}(data_ptr=program_data_ptr);
    // Write hash_chain result to output_ptr + 1.
    assert [output_ptr + 1] = hash;
    %{
        # Validate hash.
        from starkware.cairo.bootloaders.hash_program import compute_program_hash_chain

        assert memory[ids.output_ptr + 1] == compute_program_hash_chain(task.get_program()), \
          'Computed hash does not match input.'
    %}

    // Set the program entry point, so the bootloader can later run the program.
    local builtin_list: felt* = &program_header.builtin_list;
    local n_builtins = program_header.n_builtins;
    tempvar program_address = builtin_list + n_builtins;
    %{
        # Sanity check.
        assert ids.program_address == program_address
    %}
    tempvar program_main = program_header.program_main;
    // The address in memory where the main function of the task is loaded.
    local program_entry_point: felt* = program_address + program_main;

    // Fill in all builtin pointers which may be used by the task.
    // Skip the 2 slots prefix that we add to the task output.
    local pre_execution_builtin_ptrs: BuiltinData = BuiltinData(
        output=output_ptr + 2,
        pedersen=cast(pedersen_ptr, felt),
        range_check=input_builtin_ptrs.range_check,
        ecdsa=input_builtin_ptrs.ecdsa,
        bitwise=input_builtin_ptrs.bitwise,
        ec_op=input_builtin_ptrs.ec_op,
        keccak=input_builtin_ptrs.keccak,
        poseidon=input_builtin_ptrs.poseidon,
    );

    // Call select_input_builtins to get the relevant input builtin pointers for the task.
    select_input_builtins(
        all_encodings=builtin_encodings,
        all_ptrs=&pre_execution_builtin_ptrs,
        // n_all_builtins=BuiltinData.SIZE,
        selected_encodings=builtin_list,
        n_selected_builtins=n_builtins,
    );

    call_task:
    %{
        from starkware.cairo.bootloaders.simple_bootloader.objects import (
            CairoPieTask,
            RunProgramTask,
            Task,
        )
        from starkware.cairo.bootloaders.simple_bootloader.utils import (
            load_cairo_pie,
            prepare_output_runner,
        )

        assert isinstance(task, Task)
        n_builtins = len(task.get_program().builtins)
        new_task_locals = {}
        if isinstance(task, RunProgramTask):
            new_task_locals['program_input'] = task.program_input
            new_task_locals['WITH_BOOTLOADER'] = True

            vm_load_program(task.program, program_address)
        elif isinstance(task, CairoPieTask):
            ret_pc = ids.ret_pc_label.instruction_offset_ - ids.call_task.instruction_offset_ + pc
            load_cairo_pie(
                task=task.cairo_pie, memory=memory, segments=segments,
                program_address=program_address, execution_segment_address= ap - n_builtins,
                builtin_runners=builtin_runners, ret_fp=fp, ret_pc=ret_pc)
        else:
            raise NotImplementedError(f'Unexpected task type: {type(task).__name__}.')

        output_runner_data = prepare_output_runner(
            task=task,
            output_builtin=output_builtin,
            output_ptr=ids.pre_execution_builtin_ptrs.output)
        vm_enter_scope(new_task_locals)
    %}

    // Call the inner program's main() function.
    call abs program_entry_point;

    ret_pc_label:
    %{
        vm_exit_scope()
        # Note that bootloader_input will only be available in the next hint.
    %}

    // Note that used_builtins_addr cannot be set in a hint because doing so will allow a malicious
    // prover to lie about the outputs of a valid program.
    let (ap_val) = get_ap();
    local used_builtins_addr: felt* = cast(ap_val - n_builtins, felt*);

    // Call inner_select_builtins to validate that the values of the builtin pointers for the next
    // task are updated according to the task return builtin pointers.

    // Allocate a struct containing all builtin pointers just after the program returns.
    local return_builtin_ptrs: BuiltinData;
    %{
        from starkware.cairo.bootloaders.simple_bootloader.utils import write_return_builtins

        # Fill the values of all builtin pointers after executing the task.
        builtins = task.get_program().builtins
        write_return_builtins(
            memory=memory, return_builtins_addr=ids.return_builtin_ptrs.address_,
            used_builtins=builtins, used_builtins_addr=ids.used_builtins_addr,
            pre_execution_builtins_addr=ids.pre_execution_builtin_ptrs.address_, task=task)

        vm_enter_scope({'n_selected_builtins': n_builtins})
    %}
    let select_builtins_ret = inner_select_builtins(
        all_encodings=builtin_encodings,
        all_ptrs=&return_builtin_ptrs,
        selected_encodings=builtin_list,
        selected_ptrs=used_builtins_addr,
        n_builtins=BuiltinData.SIZE,
    );
    %{ vm_exit_scope() %}

    // Assert that the correct number of builtins was selected.
    // Note that builtin_list is a pointer to the list containing the selected encodings.
    assert n_builtins = select_builtins_ret.selected_encodings_end - builtin_list;

    // Call validate_builtins to validate that the builtin pointers have advanced correctly.
    validate_builtins{range_check_ptr=self_range_check_ptr}(
        prev_builtin_ptrs=&pre_execution_builtin_ptrs,
        new_builtin_ptrs=&return_builtin_ptrs,
        builtin_instance_sizes=builtin_instance_sizes,
        n_builtins=BuiltinData.SIZE,
    );

    // Verify that [output_ptr] = return_builtin_ptrs.output - output_ptr.
    // Output size should be 2 + the number of output slots that were consumed by the task.
    local output_size = return_builtin_ptrs.output - output_ptr;
    assert [output_ptr] = output_size;

    %{
        from starkware.cairo.bootloaders.simple_bootloader.utils import get_task_fact_topology

        # Add the fact topology of the current task to 'fact_topologies'.
        output_start = ids.pre_execution_builtin_ptrs.output
        output_end = ids.return_builtin_ptrs.output
        fact_topologies.append(get_task_fact_topology(
            output_size=output_end - output_start,
            task=task,
            output_builtin=output_builtin,
            output_runner_data=output_runner_data,
        ))
    %}

    let builtin_ptrs = &return_builtin_ptrs;
    return ();
}

from starkware.cairo.bootloaders.simple_bootloader.execute_task import BuiltinData, execute_task
from starkware.cairo.common.cairo_builtins import HashBuiltin
from starkware.cairo.common.registers import get_fp_and_pc

// Loads the programs and executes them.
//
// Hint Arguments:
// simple_bootloader_input - contains the tasks to execute.
//
// Returns:
// Updated builtin pointers after executing all programs.
// fact_topologies - that corresponds to the tasks (hint variable).
func run_simple_bootloader{
    output_ptr: felt*,
    pedersen_ptr: HashBuiltin*,
    range_check_ptr,
    ecdsa_ptr,
    bitwise_ptr,
    ec_op_ptr,
    keccak_ptr,
    poseidon_ptr,
}() {
    alloc_locals;
    local task_range_check_ptr;

    %{
        n_tasks = 0 #len(simple_bootloader_input.tasks)
        memory[ids.output_ptr] = n_tasks

        # Task range checks are located right after simple bootloader validation range checks, and
        # this is validated later in this function.
        ids.task_range_check_ptr = ids.range_check_ptr + ids.BuiltinData.SIZE * n_tasks

        # A list of fact_toplogies that instruct how to generate the fact from the program output
        # for each task.
        fact_topologies = []
    %}

    let n_tasks = [output_ptr];
    let output_ptr = output_ptr + 1;

    // A struct containing the pointer to each builtin.
    local builtin_ptrs_before: BuiltinData = BuiltinData(
        output=cast(output_ptr, felt),
        pedersen=cast(pedersen_ptr, felt),
        range_check=task_range_check_ptr,
        ecdsa=ecdsa_ptr,
        bitwise=bitwise_ptr,
        ec_op=ec_op_ptr,
        keccak=keccak_ptr,
        poseidon=poseidon_ptr,
    );

    // A struct containing the encoding of each builtin.
    local builtin_encodings: BuiltinData = BuiltinData(
        output='output',
        pedersen='pedersen',
        range_check='range_check',
        ecdsa='ecdsa',
        bitwise='bitwise',
        ec_op='ec_op',
        keccak='keccak',
        poseidon='poseidon',
    );

    local builtin_instance_sizes: BuiltinData = BuiltinData(
        output=1, pedersen=3, range_check=1, ecdsa=2, bitwise=5, ec_op=7, keccak=16, poseidon=6
    );

    // Call execute_tasks.
    let (__fp__, _) = get_fp_and_pc();

    // %{ tasks = simple_bootloader_input.tasks %}
    %{ tasks = [] %}
    let builtin_ptrs = &builtin_ptrs_before;
    let self_range_check_ptr = range_check_ptr;
    with builtin_ptrs, self_range_check_ptr {
        execute_tasks(
            builtin_encodings=&builtin_encodings,
            builtin_instance_sizes=&builtin_instance_sizes,
            n_tasks=n_tasks,
        );
    }

    // Verify that the task range checks appear after the self range checks of execute_task.
    assert self_range_check_ptr = task_range_check_ptr;

    // Return the updated builtin pointers.
    local builtin_ptrs: BuiltinData* = builtin_ptrs;
    let output_ptr = cast(builtin_ptrs.output, felt*);
    let pedersen_ptr = cast(builtin_ptrs.pedersen, HashBuiltin*);
    let range_check_ptr = builtin_ptrs.range_check;
    let ecdsa_ptr = builtin_ptrs.ecdsa;
    let bitwise_ptr = builtin_ptrs.bitwise;
    let ec_op_ptr = builtin_ptrs.ec_op;
    let keccak_ptr = builtin_ptrs.keccak;
    let poseidon_ptr = builtin_ptrs.poseidon;

    // 'execute_tasks' runs untrusted code and uses the range_check builtin to verify that
    // the builtin pointers were advanced correctly by said code.
    // Since range_check itself is used for the verification, we cannot assume that the verification
    // above is sound unless we know that the self range checks that were used during verification
    // are indeed valid (that is, within the segment of the range_check builtin).
    // Following the Cairo calling convention, we can guarantee the validity of the self range
    // checks by making sure that range_check_ptr >= self_range_check_ptr.
    // The following check validates that the inequality above holds without using the range check
    // builtin.
    let additional_range_checks = range_check_ptr - self_range_check_ptr;
    verify_non_negative(num=additional_range_checks, n_bits=64);

    return ();
}

// Verifies that a field element is in the range [0, 2^n_bits), without relying on the range_check
// builtin.
func verify_non_negative(num: felt, n_bits: felt) {
    if (n_bits == 0) {
        assert num = 0;
        return ();
    }

    tempvar num_div2 = nondet %{ ids.num // 2 %};
    tempvar bit = num - (num_div2 + num_div2);
    // Check that bit is 0 or 1.
    assert bit = bit * bit;
    return verify_non_negative(num=num_div2, n_bits=n_bits - 1);
}

// Executes the last n_tasks from simple_bootloader_input.tasks.
//
// Arguments:
// builtin_encodings - String encodings of the builtins.
// builtin_instance_sizes - Mapping to builtin sizes.
// n_tasks - The number of tasks to execute.
//
// Implicit arguments:
// builtin_ptrs - Pointer to the builtin pointers before/after executing the tasks.
// self_range_check_ptr - range_check pointer (used for validating the builtins).
//
// Hint arguments:
// tasks - A list of tasks to execute.
func execute_tasks{builtin_ptrs: BuiltinData*, self_range_check_ptr}(
    builtin_encodings: BuiltinData*, builtin_instance_sizes: BuiltinData*, n_tasks
) {
    if (n_tasks == 0) {
        return ();
    }

    %{
        from starkware.cairo.bootloaders.simple_bootloader.objects import Task

        # Pass current task to execute_task.
        task_id = len(simple_bootloader_input.tasks) - ids.n_tasks
        task = simple_bootloader_input.tasks[task_id].load_task()
    %}
    // Call execute_task to execute the current task.
    execute_task(
        builtin_encodings=builtin_encodings, builtin_instance_sizes=builtin_instance_sizes
    );

    return execute_tasks(
        builtin_encodings=builtin_encodings,
        builtin_instance_sizes=builtin_instance_sizes,
        n_tasks=n_tasks - 1,
    );
}

// An helper function to extract selected_ptrs from all_ptrs according to the builtin encodings
// that appear in the selected_encodings list.
// The caller needs to pass n_selected_builtins as a hint.
// Returns a pointer to the next memory slot after the selected_encodings list, see "Assumptions".
//
// For example, given the following setup:
//   - all_encodings points to ["output", "pedersen", "range-check"].
//   - selected_encodings points to ["output", "range-check"]
//   - all_ptrs points to [output_ptr, pedersen_ptr, range_check_ptr]
//   - The caller asserts that the return value is selected_encodings + n_selected_builtins(2).
// The function will check that selected_encodings points to [output_ptr, range_check_ptr].
//
// n_builtins is the length of the list of *all pointers*.
// Assumptions:
// * The caller has to check that n_selected_builtins = selected_encodings_end - selected_encodings.
// * All lists are sorted according to the order of builtins input in Cairo programs.
// * len(selected_encodings) <= len(all_encodings) == len(all_ptrs).
func inner_select_builtins(
    all_encodings: felt*,
    all_ptrs: felt*,
    selected_encodings: felt*,
    selected_ptrs: felt*,
    n_builtins,
) -> (selected_encodings_end: felt*) {
    // Number of memory cells used when n_builtins = 0.
    const FUNC_MEMORY_NO_BUILTINS = 1;
    // Number of memory cells used *in a single iteration* when n_builtins > 0.
    const FUNC_MEMORY_WITH_BUILTINS = 10;

    if (n_builtins == 0) {
        // Return a pointer to the end of the selected_encodings list.
        return (selected_encodings_end=selected_encodings);
    }

    alloc_locals;
    // select_builtin equals 1 if the first builtin should be selected and 0 otherwise.
    local select_builtin;
    %{
        # A builtin should be selected iff its encoding appears in the selected encodings list
        # and the list wasn't exhausted.
        # Note that testing inclusion by a single comparison is possible since the lists are sorted.
        ids.select_builtin = int(
          n_selected_builtins > 0 and memory[ids.selected_encodings] == memory[ids.all_encodings])
        if ids.select_builtin:
          n_selected_builtins = n_selected_builtins - 1
    %}
    // Verify that select_builtin is a bit.
    select_builtin = select_builtin * select_builtin;

    local curr_builtin_encoding = [all_encodings];
    local curr_builtin_ptr = [all_ptrs];

    if (select_builtin != 0) {
        // Verify that the current builtin is indeed selected, by asserting that its encoding
        // appears in the selected encodings list.
        curr_builtin_encoding = [selected_encodings];
        // Copy the current builtin pointer between selected_ptrs and all_ptrs.
        curr_builtin_ptr = [selected_ptrs];
    }

    // Advance all list pointers accordingly and continue selection by calling inner_select_builtins
    // recursively.
    // Lists of selected builtins/encodings should advance only if the current builtin was selected.
    return inner_select_builtins(
        all_encodings=all_encodings + 1,
        all_ptrs=all_ptrs + 1,
        selected_encodings=selected_encodings + select_builtin,
        selected_ptrs=selected_ptrs + select_builtin,
        n_builtins=n_builtins - 1,
    );
}

from starkware.cairo.builtin_selection.inner_select_builtins import inner_select_builtins
from starkware.cairo.common.registers import get_fp_and_pc

// A wrapper for 'inner_select_builtins' function (see its documentation).
// Returns the selected builtin pointers (e.g., if n_selected_builtins=2, returns two values).
func select_input_builtins(
    all_encodings: felt*, all_ptrs: felt*, selected_encodings: felt*, n_selected_builtins
) {
    // Total number of optional builtins
    const N_BUILTINS = 8;

    // Number of memory cells used, without taking the inner function memory into account.
    const FUNC_MEMORY_WITHOUT_INNER_FUNC = 11;
    const INNER_FUNC_MEMORY_PER_ITERATION = inner_select_builtins.FUNC_MEMORY_WITH_BUILTINS;
    const INNER_FUNC_MEMORY_FINAL_ITERATION = inner_select_builtins.FUNC_MEMORY_NO_BUILTINS;
    // 'inner_select_builtins' has n_all_builtins iterations, until the final halting one, when
    // called with n_builtins = n_all_builtins.
    const INNER_FUNC_MEMORY = N_BUILTINS * INNER_FUNC_MEMORY_PER_ITERATION +
        INNER_FUNC_MEMORY_FINAL_ITERATION;
    const TOTAL_FUNC_MEMORY = FUNC_MEMORY_WITHOUT_INNER_FUNC + INNER_FUNC_MEMORY;

    let frame = call get_fp_and_pc;
    // The selected builtin pointers are the return values at the end of the function memory.
    // let selected_ptrs = frame.fp_val + total_func_memory;
    let selected_ptrs = cast(frame.fp_val + TOTAL_FUNC_MEMORY, felt*);
    %{ vm_enter_scope({'n_selected_builtins': ids.n_selected_builtins}) %}
    let inner_ret = inner_select_builtins(
        all_encodings=all_encodings,
        all_ptrs=all_ptrs,
        selected_encodings=selected_encodings,
        selected_ptrs=selected_ptrs,
        n_builtins=N_BUILTINS,
    );
    %{ vm_exit_scope() %}
    // Assert that the correct number of builtins was selected.
    n_selected_builtins = inner_ret.selected_encodings_end - selected_encodings;

    ap += n_selected_builtins;
    ret;
}

// Validates that the builtin pointer of a single builtin was advanced correctly.
// The inputs are:
//   The previous builtin pointer.
//   The new builtin pointer.
//   The size of the builtin instances.
// The function validates that the difference between the new builtin pointer and the old builtin
// pointer is a positive integer divisible by the given builtin instance size.
//
// The function consumes 1 range check instance starting at range_check_ptr and returns the
// updated range check pointer.
func validate_builtin{range_check_ptr}(
    prev_builtin_ptr: felt*, new_builtin_ptr: felt*, builtin_instance_size: felt
) {
    // Check that the difference is positive and divisible by builtin_instance_size by checking that
    // 0 <= div_res < RANGE_CHECK_BOUND and diff = div_res * builtin_instance_size.
    tempvar diff = new_builtin_ptr - prev_builtin_ptr;
    tempvar div_res = diff / builtin_instance_size;
    div_res = [range_check_ptr];
    let range_check_ptr = range_check_ptr + 1;
    return ();
}

// Validates that the builtin pointers were advanced correctly.
//
// The inputs are:
//   The previous list of builtin pointers.
//   The new list of builtin pointers.
//   The sizes of the builtin instances.
//   The number of builtins.
//
// For each builtin the function validates that the difference between the new builtin pointer and
// the old builtin pointer is a nonnegative integer divisible by the corresponding builtin
// instance size.
//
// The function consumes n_builtins range check instances starting at range_check_ptr and returns
// the updated range check pointer.
func validate_builtins{range_check_ptr}(
    prev_builtin_ptrs: felt*, new_builtin_ptrs: felt*, builtin_instance_sizes: felt*, n_builtins
) {
    if (n_builtins == 0) {
        return ();
    }

    validate_builtin(
        prev_builtin_ptr=cast([prev_builtin_ptrs], felt*),
        new_builtin_ptr=cast([new_builtin_ptrs], felt*),
        builtin_instance_size=[builtin_instance_sizes],
    );

    return validate_builtins(
        prev_builtin_ptrs=prev_builtin_ptrs + 1,
        new_builtin_ptrs=new_builtin_ptrs + 1,
        builtin_instance_sizes=builtin_instance_sizes + 1,
        n_builtins=n_builtins - 1,
    );
}

