from starkware.cairo.common.math import assert_le, assert_le_felt, assert_nn_le

const FIND_ELEMENT_RANGE_CHECK_USAGE = 2;

// Finds an element in the array whose first field is key and returns a pointer
// to this element.
// Since cairo is nondeterministic this is an O(1) operation.
// Note however that if the array has multiple elements with said key the function may return any
// of those elements.
//
// Arguments:
// array_ptr - pointer to an array.
// elm_size - size of an element in the array.
// n_elms - number of element in the array.
// key - key to look for.
//
// Implicit arguments:
// range_check_ptr - range check builtin pointer.
//
// Returns:
// elm_ptr - pointer to an element in the array satisfying [ptr] = key.
//
// Optional hint variables:
// __find_element_index - the index that should be returned. If not specified, the function will
//   return the first index that has the key.
func find_element{range_check_ptr}(array_ptr: felt*, elm_size, n_elms, key) -> (elm_ptr: felt*) {
    alloc_locals;
    local index;
    %{
        array_ptr = ids.array_ptr
        elm_size = ids.elm_size
        assert isinstance(elm_size, int) and elm_size > 0, \
            f'Invalid value for elm_size. Got: {elm_size}.'
        key = ids.key

        if '__find_element_index' in globals():
            ids.index = __find_element_index
            found_key = memory[array_ptr + elm_size * __find_element_index]
            assert found_key == key, \
                f'Invalid index found in __find_element_index. index: {__find_element_index}, ' \
                f'expected key {key}, found key: {found_key}.'
            # Delete __find_element_index to make sure it's not used for the next calls.
            del __find_element_index
        else:
            n_elms = ids.n_elms
            assert isinstance(n_elms, int) and n_elms >= 0, \
                f'Invalid value for n_elms. Got: {n_elms}.'
            if '__find_element_max_size' in globals():
                assert n_elms <= __find_element_max_size, \
                    f'find_element() can only be used with n_elms<={__find_element_max_size}. ' \
                    f'Got: n_elms={n_elms}.'

            for i in range(n_elms):
                if memory[array_ptr + elm_size * i] == key:
                    ids.index = i
                    break
            else:
                raise ValueError(f'Key {key} was not found.')
    %}

    assert_nn_le(a=index, b=n_elms - 1);
    tempvar elm_ptr = array_ptr + elm_size * index;
    assert [elm_ptr] = key;
    return (elm_ptr=elm_ptr);
}

// Given an array sorted by its first field, returns the pointer to the first element in the array
// whose first field is at least key. If no such item exists, returns a pointer to the end of the
// array.
// Prover assumption: all the keys (the first field in each item) are in [0, RANGE_CHECK_BOUND).
func search_sorted_lower{range_check_ptr}(array_ptr: felt*, elm_size, n_elms, key) -> (
    elm_ptr: felt*
) {
    alloc_locals;
    local index;
    %{
        array_ptr = ids.array_ptr
        elm_size = ids.elm_size
        assert isinstance(elm_size, int) and elm_size > 0, \
            f'Invalid value for elm_size. Got: {elm_size}.'

        n_elms = ids.n_elms
        assert isinstance(n_elms, int) and n_elms >= 0, \
            f'Invalid value for n_elms. Got: {n_elms}.'
        if '__find_element_max_size' in globals():
            assert n_elms <= __find_element_max_size, \
                f'find_element() can only be used with n_elms<={__find_element_max_size}. ' \
                f'Got: n_elms={n_elms}.'

        for i in range(n_elms):
            if memory[array_ptr + elm_size * i] >= ids.key:
                ids.index = i
                break
        else:
            ids.index = n_elms
    %}

    assert_nn_le(a=index, b=n_elms);
    local elm_ptr: felt* = array_ptr + elm_size * index;

    if (index != n_elms) {
        assert_le_felt(a=key, b=[elm_ptr]);
    } else {
        tempvar range_check_ptr = range_check_ptr;
    }

    if (index != 0) {
        assert_le_felt(a=[elm_ptr - elm_size] + 1, b=key);
    }

    return (elm_ptr=elm_ptr);
}

// Given an array sorted by its first field, returns the pointer to the first element in the array
// whose first field is exactly key. If no such item exists, returns an undefined pointer,
// and success=0.
// Prover assumption: all the keys (the first field in each item) are in [0, RANGE_CHECK_BOUND).
func search_sorted{range_check_ptr}(array_ptr: felt*, elm_size, n_elms, key) -> (
    elm_ptr: felt*, success: felt
) {
    let (elm_ptr) = search_sorted_lower(
        array_ptr=array_ptr, elm_size=elm_size, n_elms=n_elms, key=key
    );
    tempvar array_end = array_ptr + elm_size * n_elms;
    if (elm_ptr == array_end) {
        return (elm_ptr=array_ptr, success=0);
    }
    if ([elm_ptr] != key) {
        return (elm_ptr=array_ptr, success=0);
    }
    return (elm_ptr=elm_ptr, success=1);
}

from starkware.cairo.common.cairo_builtins import HashBuiltin

// Computes the hash of two given field elements.
// The hash function is defined by the hash_ptr used.
// For example, pass the pedersen builtin pointer to compute Pedersen hash.
//
// Arguments:
//   hash_ptr - the hash builtin pointer.
//   x, y - the two field elements to be hashed, in this order.
//
// Returns:
//   result - the field element result of the hash.
func hash2{hash_ptr: HashBuiltin*}(x, y) -> (result: felt) {
    hash_ptr.x = x;
    hash_ptr.y = y;
    let result = hash_ptr.result;
    let hash_ptr = hash_ptr + HashBuiltin.SIZE;
    return (result=result);
}

from starkware.cairo.common.cairo_builtins import HashBuiltin

// Computes a hash chain of a sequence whose length is given at [data_ptr] and the data starts at
// data_ptr + 1. The hash is calculated backwards (from the highest memory address to the lowest).
// For example, for the 3-element sequence [x, y, z] the hash is:
//   h(3, h(x, h(y, z)))
// If data_length = 0, the function does not return (takes more than field prime steps).
func hash_chain{hash_ptr: HashBuiltin*}(data_ptr: felt*) -> (hash: felt) {
    struct LoopLocals {
        data_ptr: felt*,
        hash_ptr: HashBuiltin*,
        cur_hash: felt,
    }

    tempvar data_length = [data_ptr];
    tempvar data_ptr_end = data_ptr + data_length;
    // Prepare the loop_frame for the first iteration of the hash_loop.
    tempvar loop_frame = LoopLocals(
        data_ptr=data_ptr_end, hash_ptr=hash_ptr, cur_hash=[data_ptr_end]
    );

    hash_loop:
    let curr_frame = cast(ap - LoopLocals.SIZE, LoopLocals*);
    let current_hash: HashBuiltin* = curr_frame.hash_ptr;

    tempvar new_data = [curr_frame.data_ptr - 1];

    let n_elements_to_hash = [ap];
    // Assign current_hash inputs and allocate space for n_elements_to_hash.
    current_hash.x = new_data, ap++;
    current_hash.y = curr_frame.cur_hash;

    // Set the frame for the next loop iteration (going backwards).
    tempvar next_frame = LoopLocals(
        data_ptr=curr_frame.data_ptr - 1,
        hash_ptr=curr_frame.hash_ptr + HashBuiltin.SIZE,
        cur_hash=current_hash.result,
    );

    // Update n_elements_to_hash and loop accordingly. Note that the hash is calculated backwards.
    n_elements_to_hash = next_frame.data_ptr - data_ptr;
    jmp hash_loop if n_elements_to_hash != 0;

    // Set the hash_ptr implicit argument and return the result.
    let hash_ptr = next_frame.hash_ptr;
    return (hash=next_frame.cur_hash);
}

from starkware.cairo.common.cairo_builtins import HashBuiltin
from starkware.cairo.common.hash import hash2
from starkware.cairo.common.registers import get_fp_and_pc

// Stores the hash of a sequence of items. New items can be added to the hash state using
// hash_update and hash_update_single.
// The final hash of the entire sequence, including the sequence length,
// can be extracted using hash_finalize.
// For example, the hash of the sequence (x, y, z) is h(h(h(h(0, x), y), z), 3).
// In particular, the hash of zero items is h(0, 0).
struct HashState {
    current_hash: felt,
    n_words: felt,
}

// Initializes a new HashState with no items and returns it.
func hash_init() -> (hash_state_ptr: HashState*) {
    alloc_locals;
    let (__fp__, _) = get_fp_and_pc();
    local hash_state: HashState;
    hash_state.current_hash = 0;
    hash_state.n_words = 0;
    return (hash_state_ptr=&hash_state);
}

// Adds each item in an array of items to the HashState.
// Returns a new HashState with the hash of the items of the input HashState and the array of items.
// The array is represented by a pointer and a length.
func hash_update{hash_ptr: HashBuiltin*}(
    hash_state_ptr: HashState*, data_ptr: felt*, data_length
) -> (new_hash_state_ptr: HashState*) {
    alloc_locals;
    let (hash) = hash_felts_no_padding(
        data_ptr=data_ptr, data_length=data_length, initial_hash=hash_state_ptr.current_hash
    );
    let (__fp__, _) = get_fp_and_pc();
    local new_hash_state: HashState;
    new_hash_state.current_hash = hash;
    assert new_hash_state.n_words = hash_state_ptr.n_words + data_length;
    return (new_hash_state_ptr=&new_hash_state);
}

// Adds a single item to the HashState.
// Returns a new HashState with the hash of the items of the input HashState and the item.
func hash_update_single{hash_ptr: HashBuiltin*}(hash_state_ptr: HashState*, item) -> (
    new_hash_state_ptr: HashState*
) {
    alloc_locals;
    let (hash) = hash2(x=hash_state_ptr.current_hash, y=item);
    let (__fp__, _) = get_fp_and_pc();
    local new_hash_state: HashState;
    new_hash_state.current_hash = hash;
    assert new_hash_state.n_words = hash_state_ptr.n_words + 1;
    return (new_hash_state_ptr=&new_hash_state);
}

// Computes the hash of the input data and then calls hash_update_single to add the hash
// of the data to 'hash_state' as a single felt. See details in the documentation of HashState.
func hash_update_with_hashchain{hash_ptr: HashBuiltin*}(
    hash_state_ptr: HashState*, data_ptr: felt*, data_length: felt
) -> (new_hash_state_ptr: HashState*) {
    // Hash data.
    let (hash: felt) = hash_felts(data=data_ptr, length=data_length);

    // Update 'hash_state' with the hash of the data.
    return hash_update_single(hash_state_ptr=hash_state_ptr, item=hash);
}

// Returns the hash result of the HashState.
func hash_finalize{hash_ptr: HashBuiltin*}(hash_state_ptr: HashState*) -> (hash: felt) {
    let (hash) = hash2(x=hash_state_ptr.current_hash, y=hash_state_ptr.n_words);
    return (hash=hash);
}

// A helper function for 'hash_update', see its documentation.
// Computes the hash of an array of items, not including its length.
// The hash is: hash(...hash(hash(initial_hash, data[0]), data[1])..., data[n-1]).
//
// NOTE: when this function is used directly (instead of using 'hash_update' and 'hash_finalize'),
// one must make sure that the result is collision-resistant. For example, by including the length
// in the outermost hash.
func hash_felts_no_padding{hash_ptr: HashBuiltin*}(
    data_ptr: felt*, data_length: felt, initial_hash: felt
) -> (hash: felt) {
    if (data_length == 0) {
        return (hash=initial_hash);
    }

    // Compute 'data_last_ptr' before entering the loop.
    alloc_locals;
    local data_last_ptr: felt* = data_ptr + data_length - 1;
    struct LoopLocals {
        data_ptr: felt*,
        hash_ptr: HashBuiltin*,
        cur_hash: felt,
    }

    // Set up first iteration locals.
    let first_locals: LoopLocals* = cast(ap, LoopLocals*);
    first_locals.data_ptr = data_ptr, ap++;
    first_locals.hash_ptr = hash_ptr, ap++;
    first_locals.cur_hash = initial_hash, ap++;

    // Do{.
    hash_loop:
    let prev_locals: LoopLocals* = cast(ap - LoopLocals.SIZE, LoopLocals*);
    tempvar n_remaining_elements = data_last_ptr - prev_locals.data_ptr;

    // Compute hash(cur_hash, [data_ptr]).
    prev_locals.hash_ptr.x = prev_locals.cur_hash;
    assert prev_locals.hash_ptr.y = [prev_locals.data_ptr];  // Allocates one memory cell.

    // Set up next iteration locals.
    let next_locals: LoopLocals* = cast(ap, LoopLocals*);
    next_locals.data_ptr = prev_locals.data_ptr + 1, ap++;
    next_locals.hash_ptr = prev_locals.hash_ptr + HashBuiltin.SIZE, ap++;
    next_locals.cur_hash = prev_locals.hash_ptr.result, ap++;

    // } while(n_remaining_elements != 0).
    jmp hash_loop if n_remaining_elements != 0;

    // Return values from final iteration.
    let final_locals: LoopLocals* = cast(ap - LoopLocals.SIZE, LoopLocals*);
    let hash_ptr = final_locals.hash_ptr;
    return (hash=final_locals.cur_hash);
}

// Hashing an arbitrary-length input has the risk of creating a hashing algorithm that is not
// collision-resistant. Consider the following hashing algorithm of an array:
//   h(a_1, ..., a_n) = h(h(a_1, a_2), ..., a_n)
// and consider the following inputs: [2, 1, 0] and [h(2, 1), 0].
// Both inputs produce the same hash.
//
// To resolve this we append the length of the input as the outermost hash, allowing `hash_felts`
// to retain the collision resistance of `hash2`.
func hash_felts{hash_ptr: HashBuiltin*}(data: felt*, length: felt) -> (hash: felt) {
    let (hash_state_ptr: HashState*) = hash_init();
    let (hash_state_ptr) = hash_update(
        hash_state_ptr=hash_state_ptr, data_ptr=data, data_length=length
    );
    return hash_finalize(hash_state_ptr=hash_state_ptr);
}

from starkware.cairo.common.bool import FALSE, TRUE

// Inline functions with no locals.

// Verifies that value != 0. The proof will fail otherwise.
func assert_not_zero(value) {
    %{
        from starkware.cairo.common.math_utils import assert_integer
        assert_integer(ids.value)
        assert ids.value % PRIME != 0, f'assert_not_zero failed: {ids.value} = 0.'
    %}
    if (value == 0) {
        // If value == 0, add an unsatisfiable requirement.
        value = 1;
    }

    return ();
}

// Verifies that a != b. The proof will fail otherwise.
func assert_not_equal(a, b) {
    %{
        from starkware.cairo.lang.vm.relocatable import RelocatableValue
        both_ints = isinstance(ids.a, int) and isinstance(ids.b, int)
        both_relocatable = (
            isinstance(ids.a, RelocatableValue) and isinstance(ids.b, RelocatableValue) and
            ids.a.segment_index == ids.b.segment_index)
        assert both_ints or both_relocatable, \
            f'assert_not_equal failed: non-comparable values: {ids.a}, {ids.b}.'
        assert (ids.a - ids.b) % PRIME != 0, f'assert_not_equal failed: {ids.a} = {ids.b}.'
    %}
    if (a == b) {
        // If a == b, add an unsatisfiable requirement.
        a = a + 1;
    }

    return ();
}

// Verifies that a >= 0 (or more precisely 0 <= a < RANGE_CHECK_BOUND).
func assert_nn{range_check_ptr}(a) {
    %{
        from starkware.cairo.common.math_utils import assert_integer
        assert_integer(ids.a)
        assert 0 <= ids.a % PRIME < range_check_builtin.bound, f'a = {ids.a} is out of range.'
    %}
    a = [range_check_ptr];
    let range_check_ptr = range_check_ptr + 1;
    return ();
}

// Verifies that a <= b (or more precisely 0 <= b - a < RANGE_CHECK_BOUND).
func assert_le{range_check_ptr}(a, b) {
    assert_nn(b - a);
    return ();
}

// Verifies that a <= b - 1 (or more precisely 0 <= b - 1 - a < RANGE_CHECK_BOUND).
func assert_lt{range_check_ptr}(a, b) {
    assert_le(a, b - 1);
    return ();
}

// Verifies that 0 <= a <= b.
//
// Prover assumption: b < RANGE_CHECK_BOUND.
//
// This function is still sound without the prover assumptions. In that case, it is guaranteed
// that a < RANGE_CHECK_BOUND and b < 2 * RANGE_CHECK_BOUND.
func assert_nn_le{range_check_ptr}(a, b) {
    assert_nn(a);
    assert_le(a, b);
    return ();
}

// Asserts that value is in the range [lower, upper).
// Or more precisely:
// (0 <= value - lower < RANGE_CHECK_BOUND) and (0 <= upper - 1 - value < RANGE_CHECK_BOUND).
//
// Prover assumption: 0 <= upper - lower <= RANGE_CHECK_BOUND.
func assert_in_range{range_check_ptr}(value, lower, upper) {
    assert_le(lower, value);
    assert_le(value, upper - 1);
    return ();
}

// Asserts that 'value' is in the range [0, 2**250).
@known_ap_change
func assert_250_bit{range_check_ptr}(value) {
    const UPPER_BOUND = 2 ** 250;
    const SHIFT = 2 ** 128;
    const HIGH_BOUND = UPPER_BOUND / SHIFT;

    let low = [range_check_ptr];
    let high = [range_check_ptr + 1];

    %{
        from starkware.cairo.common.math_utils import as_int

        # Correctness check.
        value = as_int(ids.value, PRIME) % PRIME
        assert value < ids.UPPER_BOUND, f'{value} is outside of the range [0, 2**250).'

        # Calculation for the assertion.
        ids.high, ids.low = divmod(ids.value, ids.SHIFT)
    %}

    assert [range_check_ptr + 2] = HIGH_BOUND - 1 - high;

    // The assert below guarantees that
    //   value = high * SHIFT + low <= (HIGH_BOUND - 1) * SHIFT + 2**128 - 1 =
    //   HIGH_BOUND * SHIFT - SHIFT + SHIFT - 1 = 2**250 - 1.
    assert value = high * SHIFT + low;

    let range_check_ptr = range_check_ptr + 3;
    return ();
}

// Splits the unsigned integer lift of a field element into the higher 128 bit and lower 128 bit.
// The unsigned integer lift is the unique integer in the range [0, PRIME) that represents the field
// element.
// For example, if value=17 * 2^128 + 8, then high=17 and low=8.
@known_ap_change
func split_felt{range_check_ptr}(value) -> (high: felt, low: felt) {
    // Note: the following code works because PRIME - 1 is divisible by 2**128.
    const MAX_HIGH = (-1) / 2 ** 128;
    const MAX_LOW = 0;

    // Guess the low and high parts of the integer.
    let low = [range_check_ptr];
    let high = [range_check_ptr + 1];
    let range_check_ptr = range_check_ptr + 2;

    %{
        from starkware.cairo.common.math_utils import assert_integer
        assert ids.MAX_HIGH < 2**128 and ids.MAX_LOW < 2**128
        assert PRIME - 1 == ids.MAX_HIGH * 2**128 + ids.MAX_LOW
        assert_integer(ids.value)
        ids.low = ids.value & ((1 << 128) - 1)
        ids.high = ids.value >> 128
    %}
    assert value = high * (2 ** 128) + low;
    if (high == MAX_HIGH) {
        assert_le(low, MAX_LOW);
    } else {
        assert_le(high, MAX_HIGH - 1);
    }
    return (high=high, low=low);
}

// Asserts that the unsigned integer lift (as a number in the range [0, PRIME)) of a is lower than
// or equal to that of b.
@known_ap_change
func assert_le_felt{range_check_ptr}(a, b) {
    // ceil(PRIME / 3 / 2 ** 128).
    const PRIME_OVER_3_HIGH = 0x2aaaaaaaaaaaab05555555555555556;
    // ceil(PRIME / 2 / 2 ** 128).
    const PRIME_OVER_2_HIGH = 0x4000000000000088000000000000001;
    // The numbers [0, a, b, PRIME - 1] should be ordered. To prove that, we show that two of the
    // 3 arcs {0 -> a, a -> b, b -> PRIME - 1} are small:
    //   One is less than PRIME / 3 + 2 ** 129.
    //   Another is less than PRIME / 2 + 2 ** 129.
    // Since the sum of the lengths of these two arcs is less than PRIME, there is no wrap-around.
    %{
        import itertools

        from starkware.cairo.common.math_utils import assert_integer
        assert_integer(ids.a)
        assert_integer(ids.b)
        a = ids.a % PRIME
        b = ids.b % PRIME
        assert a <= b, f'a = {a} is not less than or equal to b = {b}.'

        # Find an arc less than PRIME / 3, and another less than PRIME / 2.
        lengths_and_indices = [(a, 0), (b - a, 1), (PRIME - 1 - b, 2)]
        lengths_and_indices.sort()
        assert lengths_and_indices[0][0] <= PRIME // 3 and lengths_and_indices[1][0] <= PRIME // 2
        excluded = lengths_and_indices[2][1]

        memory[ids.range_check_ptr + 1], memory[ids.range_check_ptr + 0] = (
            divmod(lengths_and_indices[0][0], ids.PRIME_OVER_3_HIGH))
        memory[ids.range_check_ptr + 3], memory[ids.range_check_ptr + 2] = (
            divmod(lengths_and_indices[1][0], ids.PRIME_OVER_2_HIGH))
    %}
    // Guess two arc lengths.
    tempvar arc_short = [range_check_ptr] + [range_check_ptr + 1] * PRIME_OVER_3_HIGH;
    tempvar arc_long = [range_check_ptr + 2] + [range_check_ptr + 3] * PRIME_OVER_2_HIGH;
    let range_check_ptr = range_check_ptr + 4;

    // First, choose which arc to exclude from {0 -> a, a -> b, b -> PRIME - 1}.
    // Then, to compare the set of two arc lengths, compare their sum and product.
    let arc_sum = arc_short + arc_long;
    let arc_prod = arc_short * arc_long;

    // Exclude "0 -> a".
    %{ memory[ap] = 1 if excluded != 0 else 0 %}
    jmp skip_exclude_a if [ap] != 0, ap++;
    assert arc_sum = (-1) - a;
    assert arc_prod = (a - b) * (1 + b);
    return ();

    // Exclude "a -> b".
    skip_exclude_a:
    %{ memory[ap] = 1 if excluded != 1 else 0 %}
    jmp skip_exclude_b_minus_a if [ap] != 0, ap++;
    tempvar m1mb = (-1) - b;
    assert arc_sum = a + m1mb;
    assert arc_prod = a * m1mb;
    return ();

    // Exclude "b -> PRIME - 1".
    skip_exclude_b_minus_a:
    %{ assert excluded == 2 %}
    assert arc_sum = b;
    assert arc_prod = a * (b - a);
    ap += 2;
    return ();
}

// Asserts that the unsigned integer lift (as a number in the range [0, PRIME)) of a is lower than
// that of b.
@known_ap_change
func assert_lt_felt{range_check_ptr}(a, b) {
    %{
        from starkware.cairo.common.math_utils import assert_integer
        assert_integer(ids.a)
        assert_integer(ids.b)
        assert (ids.a % PRIME) < (ids.b % PRIME), \
            f'a = {ids.a % PRIME} is not less than b = {ids.b % PRIME}.'
    %}
    if (a == b) {
        // If a == b, add an unsatisfiable requirement.
        a = a + 1;
    }
    assert_le_felt(a, b);
    return ();
}

// Returns the absolute value of value.
// Prover asumption: -rc_bound < value < rc_bound.
@known_ap_change
func abs_value{range_check_ptr}(value) -> felt {
    tempvar is_positive: felt;
    %{
        from starkware.cairo.common.math_utils import is_positive
        ids.is_positive = 1 if is_positive(
            value=ids.value, prime=PRIME, rc_bound=range_check_builtin.bound) else 0
    %}
    if (is_positive == 0) {
        tempvar new_range_check_ptr = range_check_ptr + 1;
        tempvar abs_value = value * (-1);
        [range_check_ptr] = abs_value;
        let range_check_ptr = new_range_check_ptr;
        return abs_value;
    } else {
        [range_check_ptr] = value;
        let range_check_ptr = range_check_ptr + 1;
        return value;
    }
}

// Returns the sign of value: -1, 0 or 1.
// Prover asumption: -rc_bound < value < rc_bound.
@known_ap_change
func sign{range_check_ptr}(value) -> felt {
    if (value == 0) {
        ap += 2;
        return 0;
    }

    tempvar is_positive: felt;
    %{
        from starkware.cairo.common.math_utils import is_positive
        ids.is_positive = 1 if is_positive(
            value=ids.value, prime=PRIME, rc_bound=range_check_builtin.bound) else 0
    %}
    if (is_positive == 0) {
        assert [range_check_ptr] = value * (-1);
        let range_check_ptr = range_check_ptr + 1;
        return -1;
    } else {
        ap += 1;
        [range_check_ptr] = value;
        let range_check_ptr = range_check_ptr + 1;
        return 1;
    }
}

// Returns q and r such that:
//  0 <= q < rc_bound, 0 <= r < div and value = q * div + r.
//
// Assumption: 0 < div <= PRIME / rc_bound.
// Prover assumption: value / div < rc_bound.
//
// The value of div is restricted to make sure there is no overflow.
// q * div + r < (q + 1) * div <= rc_bound * (PRIME / rc_bound) = PRIME.
func unsigned_div_rem{range_check_ptr}(value, div) -> (q: felt, r: felt) {
    let r = [range_check_ptr];
    let q = [range_check_ptr + 1];
    let range_check_ptr = range_check_ptr + 2;
    %{
        from starkware.cairo.common.math_utils import assert_integer
        assert_integer(ids.div)
        assert 0 < ids.div <= PRIME // range_check_builtin.bound, \
            f'div={hex(ids.div)} is out of the valid range.'
        ids.q, ids.r = divmod(ids.value, ids.div)
    %}
    assert_le(r, div - 1);

    assert value = q * div + r;
    return (q, r);
}

// Returns q and r such that. -bound <= q < bound, 0 <= r < div and value = q * div + r.
// value < PRIME / 2 is considered positive and value > PRIME / 2 is considered negative.
//
// Assumptions:
//   0 < div <= PRIME / (rc_bound)
//   bound <= rc_bound / 2.
// Prover assumption:   -bound <= value / div < bound.
//
// The values of div and bound are restricted to make sure there is no overflow.
// q * div + r <  (q + 1) * div <=  rc_bound / 2 * (PRIME / rc_bound)
// q * div + r >=  q * div      >= -rc_bound / 2 * (PRIME / rc_bound).
func signed_div_rem{range_check_ptr}(value, div, bound) -> (q: felt, r: felt) {
    let r = [range_check_ptr];
    let biased_q = [range_check_ptr + 1];  // == q + bound.
    let range_check_ptr = range_check_ptr + 2;
    %{
        from starkware.cairo.common.math_utils import as_int, assert_integer

        assert_integer(ids.div)
        assert 0 < ids.div <= PRIME // range_check_builtin.bound, \
            f'div={hex(ids.div)} is out of the valid range.'

        assert_integer(ids.bound)
        assert ids.bound <= range_check_builtin.bound // 2, \
            f'bound={hex(ids.bound)} is out of the valid range.'

        int_value = as_int(ids.value, PRIME)
        q, ids.r = divmod(int_value, ids.div)

        assert -ids.bound <= q < ids.bound, \
            f'{int_value} / {ids.div} = {q} is out of the range [{-ids.bound}, {ids.bound}).'

        ids.biased_q = q + ids.bound
    %}
    let q = biased_q - bound;
    assert value = q * div + r;
    assert_le(r, div - 1);
    assert_le(biased_q, 2 * bound - 1);
    return (q, r);
}

// Splits the given (unsigned) value into n "limbs", where each limb is in the range [0, bound),
// as follows:
//   value = x[0] + x[1] * base + x[2] * base**2 + ... + x[n - 1] * base**(n - 1).
// bound must be less than the range check bound (2**128).
// Note that bound may be smaller than base, in which case the function will fail if there is a
// limb which is >= bound.
// Assumptions:
//   1 < bound <= base
//   base**n < field characteristic.
func split_int{range_check_ptr}(value, n, base, bound, output: felt*) {
    if (n == 0) {
        %{ assert ids.value == 0, 'split_int(): value is out of range.' %}
        assert value = 0;
        return ();
    }

    %{
        memory[ids.output] = res = (int(ids.value) % PRIME) % ids.base
        assert res < ids.bound, f'split_int(): Limb {res} is out of range.'
    %}
    tempvar low_part = [output];
    assert_nn_le(low_part, bound - 1);

    return split_int(
        value=(value - low_part) / base, n=n - 1, base=base, bound=bound, output=output + 1
    );
}

// Returns the floor value of the square root of the given value.
// Assumptions: 0 <= value < 2**250.
@known_ap_change
func sqrt{range_check_ptr}(value) -> felt {
    alloc_locals;
    local root: felt;

    %{
        from starkware.python.math_utils import isqrt
        value = ids.value % PRIME
        assert value < 2 ** 250, f"value={value} is outside of the range [0, 2**250)."
        assert 2 ** 250 < PRIME
        ids.root = isqrt(value)
    %}

    assert_nn_le(root, 2 ** 125 - 1);
    tempvar root_plus_one = root + 1;
    assert_in_range(value, root * root, root_plus_one * root_plus_one);

    return root;
}

// Computes the evaluation of a polynomial on the given point.
func horner_eval(n_coefficients: felt, coefficients: felt*, point: felt) -> (res: felt) {
    if (n_coefficients == 0) {
        return (res=0);
    }

    let (n_minus_one_res) = horner_eval(
        n_coefficients=n_coefficients - 1, coefficients=&coefficients[1], point=point
    );
    return (res=n_minus_one_res * point + coefficients[0]);
}

// Returns TRUE if `x` is a quadratic residue modulo the STARK prime. Returns FALSE otherwise.
// Returns TRUE on 0.
@known_ap_change
func is_quad_residue(x: felt) -> felt {
    alloc_locals;
    local y;
    %{
        from starkware.crypto.signature.signature import FIELD_PRIME
        from starkware.python.math_utils import div_mod, is_quad_residue, sqrt

        x = ids.x
        if is_quad_residue(x, FIELD_PRIME):
            ids.y = sqrt(x, FIELD_PRIME)
        else:
            ids.y = sqrt(div_mod(x, 3, FIELD_PRIME), FIELD_PRIME)
    %}
    // Relies on the fact that 3 is not a quadratic residue modulo the prime, so for every field
    // element x, either:
    //   * x is a quadratic residue and there exists y such that y^2 = x.
    //   * x is not a quadratic residue and there exists y such that 3 * y^2 = x.
    tempvar y_squared = y * y;
    if (y_squared == x) {
        ap += 1;
        return TRUE;
    } else {
        assert 3 * y_squared = x;
        return FALSE;
    }
}

// Copies len field elements from src to dst.
func memcpy(dst: felt*, src: felt*, len) {
    struct LoopFrame {
        dst: felt*,
        src: felt*,
    }

    if (len == 0) {
        return ();
    }

    %{ vm_enter_scope({'n': ids.len}) %}
    tempvar frame = LoopFrame(dst=dst, src=src);

    loop:
    let frame = [cast(ap - LoopFrame.SIZE, LoopFrame*)];
    assert [frame.dst] = [frame.src];

    let continue_copying = [ap];
    // Reserve space for continue_copying.
    let next_frame = cast(ap + 1, LoopFrame*);
    next_frame.dst = frame.dst + 1, ap++;
    next_frame.src = frame.src + 1, ap++;
    %{
        n -= 1
        ids.continue_copying = 1 if n > 0 else 0
    %}
    static_assert next_frame + LoopFrame.SIZE == ap + 1;
    jmp loop if continue_copying != 0, ap++;
    // Assert that the loop executed len times.
    len = cast(next_frame.src, felt) - cast(src, felt);

    %{ vm_exit_scope() %}
    return ();
}

// Represents a Poseidon state.
struct PoseidonBuiltinState {
    s0: felt,
    s1: felt,
    s2: felt,
}

from starkware.cairo.lang.compiler.lib.registers import get_ap, get_fp_and_pc

// Takes the value of a label (relative to program base) and returns the actual runtime address of
// that label in the memory.
//
// Usage example:
//
// func do_callback(...) {
//     ...
// }
//
// func do_thing_then_callback(callback) {
//     ...
//     call abs callback;
// }
//
// func main() {
//     let (callback_address) = get_label_location(do_callback);
//     do_thing_then_callback(callback=callback_address);
// }
func get_label_location(label_value: codeoffset) -> (res: felt*) {
    let (_, pc_val) = get_fp_and_pc();

    ret_pc_label:
    return (res=pc_val + (label_value - ret_pc_label));
}

// Returns the contents of the fp and pc registers of the calling function.
// The pc register's value is the address of the instruction that follows directly after the
// invocation of get_fp_and_pc().
func get_fp_and_pc() -> (fp_val: felt*, pc_val: felt*) {
    // The call instruction itself already places the old fp and the return pc at
    // [ap - 2], [ap - 1].
    return (fp_val=cast([ap - 2], felt*), pc_val=cast([ap - 1], felt*));
}

// Returns the content of the ap register just before this function was invoked.
@known_ap_change
func get_ap() -> (ap_val: felt*) {
    // Once get_ap() is invoked, fp points to ap + 2 (since the call instruction placed the old fp
    // and pc in memory, advancing ap accordingly).
    // Hence, the desired ap value is fp - 2.
    let (fp_val, pc_val) = get_fp_and_pc();
    return (ap_val=fp_val - 2);
}

